  <style>
    /* === Tweak these to adjust spacing === */
    :root{
      --hero-offset-top-desktop: 30vh;   /* how far down to push the logo on desktop */
      --hero-offset-top-mobile:  20vh;   /* how far down on mobile */
      --hero-gap-below:          clamp(15px, 3vw, 80px); /* space between logo and button */
      --logo-max-desktop:        1100px; /* keep your current logo sizing */
      --logo-max-mobile:         680px;
      --glow-green: 57, 255, 20; /* #39FF14 */
    }

    /* Let hero use full width */
    .container.hero{
      max-width: 100% !important;
      width: 100% !important;
      margin: 0 auto !important;
      text-align: center;
      padding-top: var(--hero-offset-top-desktop) !important;
      padding-right: 0 !important;
      padding-bottom: var(--hero-gap-below) !important;
      padding-left: 0 !important;
    }
    @media (max-width: 700px){
      .container.hero{
        padding-top: var(--hero-offset-top-mobile) !important;
      }
    }

    /* Size rules that apply to BOTH <img> and inline <svg> when present */
    #logoMain, #logoSvg{
      display: block !important;
      margin: 0 auto !important;
      width: min(60vw, var(--logo-max-desktop)) !important;
      height: auto !important;
      max-width: none !important;
      filter: none !important; /* no heavy filter before first paint */
    }
    @media (max-width: 700px){
      #logoMain, #logoSvg{
        width: min(80vw, var(--logo-max-mobile)) !important;
      }
    }

    /* Default (desktop/tablet) gap under logo */
    .hero + .container2{
      margin-top: 4px !important;
    }
    .container2 .cta{
      margin-top: 0 !important;
      display: inline-block;
    }

    /* Mobile-only: push the Begin button further down from the logo */
    @media (max-width: 700px){
      .hero + .container2{
        margin-top: clamp(8px, 1.5vh, 200px) !important;
      }
    }

    /* Glow rules applied only after we add .glow-on (one frame later) */
    .glow-on #logoMain,
    .glow-on #logoSvg{
      filter:
        drop-shadow(0 0 10px  rgba(var(--glow-green), .85))
        drop-shadow(0 0 24px  rgba(var(--glow-green), .70))
        drop-shadow(0 0 48px  rgba(var(--glow-green), .55))
        drop-shadow(0 0 90px  rgba(var(--glow-green), .40))
        drop-shadow(0 0 140px rgba(var(--glow-green), .32)) !important;
      will-change: filter;
    }
    @media (max-width: 700px){
      .glow-on #logoMain,
      .glow-on #logoSvg{
        filter:
          drop-shadow(0 0 10px rgba(var(--glow-green), .85))
          drop-shadow(0 0 24px rgba(var(--glow-green), .60))
          drop-shadow(0 0 48px rgba(var(--glow-green), .48))
          drop-shadow(0 0 84px rgba(var(--glow-green), .36))
          drop-shadow(0 0 120px rgba(var(--glow-green), .28)) !important;
      }
    }

    /* Keep the CTA sized to its text — not full width */
    .container2 .cta{
      width: auto !important;
      min-width: 0 !important;
      display: inline-flex !important;
      align-items: center;
      justify-content: center;
      padding: 0.65rem 4rem !important;
    }
    .container2 .cta .button-text{
      display: inline-block;
      padding: 0 !important;
      text-decoration: none;
    }
    @media (max-width: 700px){
      .container2 .cta{ padding: 1rem 4rem !important; }
    }

  <!-- JS: menu open/close + mobile drawer width guard + inline-SVG swap + glow defer -->
  <script>
    (function () {
      const btn = document.getElementById('hamburger');
      const menu = document.getElementById('side-menu');
      const backdrop = document.getElementById('menu-backdrop');
      const MOBILE_BP = 700;

      function setOpen(open) {
        document.body.classList.toggle('menu-open', open);
        btn.setAttribute('aria-expanded', String(open));
        menu.setAttribute('aria-hidden', String(!open));
        backdrop.hidden = !open;
      }
      btn.addEventListener('click', () => setOpen(!document.body.classList.contains('menu-open')));
      backdrop.addEventListener('click', () => setOpen(false));
      document.addEventListener('keydown', (e) => { if (e.key === 'Escape') setOpen(false); });

      // Close drawer when a link is clicked
      menu.querySelectorAll('.menu-link').forEach(link => {
        link.addEventListener('click', () => setOpen(false));
      });

      function applyDrawerWidth() {
        const root = getComputedStyle(document.documentElement);
        const wMobile  = root.getPropertyValue('--drawer-w-mobile').trim()  || '190px';
        const wDesktop = root.getPropertyValue('--drawer-w-desktop').trim() || '220px';
        const target = (window.innerWidth <= MOBILE_BP) ? wMobile : wDesktop;
        menu.style.setProperty('width', target, 'important');
      }
      applyDrawerWidth();
      window.addEventListener('resize', applyDrawerWidth);

      // ---- Inline SVG option: if template has an <svg>, replace the <img> with it
      const t = document.getElementById('logoInline');
      const img = document.getElementById('logoMain');
      if (t && t.content && t.content.firstElementChild && t.content.firstElementChild.tagName.toLowerCase() === 'svg') {
        const svg = t.content.firstElementChild.cloneNode(true);
        svg.id = 'logoSvg';
        // Ensure nice scaling behavior
        if (!svg.getAttribute('preserveAspectRatio')) {
          svg.setAttribute('preserveAspectRatio', 'xMidYMid meet');
        }
        // Remove hardcoded width/height so CSS controls size
        svg.removeAttribute('width');
        svg.removeAttribute('height');
        img.parentNode.replaceChild(svg, img);
      }

      // Defer heavy glow by one frame so the logo (img or svg) paints immediately
      requestAnimationFrame(() => {
        document.body.classList.add('glow-on');
      });
    })();
  </script>
